import React from 'react';
import SqlHeroLogo from '../assets/images/SQL Hero Logo.png';

function LandingNav() {
    return (
        <nav className='px-52 py-3 flex justify-between border-b'>
            <img src={SqlHeroLogo} alt='' />
            <a href='' className='custom-btn'>Start Playing</a>
        </nav>
    );
}

export default LandingNav;
